const NotFound = () => {
    return (
        <>
            <div className="">
                <div className="wrapper">
                    <div>
                        <h1>404 Not Found</h1>                        
                        <p>The page you were looking for is not found.</p>
                        <p>You might have entered an incorrect url.Please enter a valid url and try again</p>                        
                    </div>                
                </div>                      
            </div> 
        </>
    );
  }

  export default NotFound;
